import React, { useState, useEffect } from "react";

const FundList = () => {
  const [funds, setFunds] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    // Load the preprocessed JSON data
    fetch("/uniqueFunds.json")
      .then((response) => response.json())
      .then((data) => {
        setFunds(data);
      })
      .catch((error) => {
        console.error("Error loading unique funds:", error);
      });
  }, []);

  const filteredFunds = funds.filter(
    (fund) =>
      fund.code.includes(searchTerm) || fund.fundname.includes(searchTerm)
  );

  return (
    <div className="fund-list-container">
      <h1>基金列表</h1>
      <input
        type="text"
        placeholder="搜索基金"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <table>
        <thead>
          <tr>
            <th>基金代码</th>
            <th>基金名称</th>
          </tr>
        </thead>
        <tbody>
          {filteredFunds.length > 0 ? (
            filteredFunds.map((fund, index) => (
              <tr key={index}>
                <td>{fund.code}</td>
                <td>{fund.fundname}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="2">无匹配结果</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default FundList;
